import React from 'react';
import { Carousel, Container } from 'react-bootstrap';
import item1 from '../pictures/photo.jpg';
import item2 from '../pictures/barber.jpg';
import item3 from '../pictures/beard trimming.jpg';
import logo from '../pictures/head.png';
import styled from 'styled-components';

const Styles = styled.div`
.carousel-item .img-fluid {
  width: 100%;
  height: 100%;
}
.index {
  z-index: -1;
  
}


`

function Home() {
  return (
    <Styles>
      <Carousel>
        <Carousel.Item>
          {/* <img
            className="d-block w-100 index"
            src={item1}
            alt="First slide"
          /> */}
          <Container>
            <Row>
              <Col xs={12} md={8}>
                xs=12 md=8
              </Col>
              <Col xs={6} md={4}>
                xs=6 md=4
              </Col>
            </Row>
          </Container>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={item2}
            alt="Third slide"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={item3}
            alt="Third slide"
          />
        </Carousel.Item>
      </Carousel>
    </Styles>
  )
}

export default Home;
